import fs from "fs";
import axios from "axios";
import jimp from "jimp";

const notFoundImage = "data:image/jpeg;base64,"
export async function fetchData(modelsList, imagePath, titleText, eventSender) {
  const result = [];

  async function handleNotFoundCase(model, notFoundImage) {
    try {
      // Generate unique filename for each not found case
      const newImagePath = `${imagePath}/${model}_notFound.png`;
      
      // Convert base64 to buffer
      const notFoundBase64 = notFoundImage.replace(/^data:image\/jpeg;base64,/, "");
      const notFoundBuffer = Buffer.from(notFoundBase64, "base64");
      
      // Create and save the not found image
      const notFound = await jimp.read(notFoundBuffer);
      await notFound.writeAsync(newImagePath);

      // Convert to base64 for UI display
      const img64 = await notFound.getBase64Async(jimp.MIME_PNG);

      // Send to UI
      eventSender.send("modelImageEvent", {
        modelName: model,
        title: "Model not found",
        image: img64,
      });

      // Add to results
      result.push({ 
        model, 
        title: "Model not found",
        path: newImagePath 
      });

      console.log(`Saved not found image for model: ${model} at ${newImagePath}`);
    } catch (error) {
      console.error(`Error handling not found case for model ${model}:`, error);
    }
  }

  async function postDataWithRetry(model, retries, delay = 3000) {
    for (let attempt = 1; attempt <= retries; attempt++) {
      try {
        await postData(model);
        break;
      } catch (error) {
        if (attempt === retries || !isSocketError(error)) {
          console.log(`Model ${model} not found or error occurred, handling as not found case`);
          await handleNotFoundCase(model, notFoundImage);
          return;
        }
        console.warn(
          `Attempt ${attempt} failed for model ${model}, retrying in ${
            delay / 1000
          } seconds...`
        );
        await new Promise((resolve) => setTimeout(resolve, delay));
      }
    }
  }

  async function postData(model) {
    try {
      const response = await axios.post(
        "https://3ddd.ru/api/models",
        { query: model },
        { timeout: 60000 }
      );

      const modelData = response.data.data.models[0];
      
      // If no model data found, handle as not found case
      if (!modelData) {
        await handleNotFoundCase(model, notFoundImage);
        return;
      }

      const firstImage = modelData.images[0];
      const titleEn = modelData.title_en;

      if (!firstImage) {
        await handleNotFoundCase(model, notFoundImage);
        return;
      }

      // Rest of the existing image processing code...
      const backends3dd = [
        "https://b5.3ddd.ru/media/cache/tuk_model_custom_filter_ang_ru/",
        "https://b6.3ddd.ru/media/cache/tuk_model_custom_filter_ang_ru/",
        "https://b7.3ddd.ru/media/cache/tuk_model_custom_filter_ang_ru/",
      ];

      let imageFound = false;

      for (const backend of backends3dd) {
        const fullImageUrl = `${backend}${firstImage.web_path}`;
        
        try {
          const rxName = /\/([^\/]+)$/;
          const imageNameMatch = fullImageUrl.match(rxName);
          const imageName = imageNameMatch && imageNameMatch[1];
          
          if (!imageName) {
            continue;
          }

          const newImagePath = `${imagePath}/${imageName}`;
          
          const imageResponse = await axios.get(fullImageUrl, {
            responseType: "arraybuffer",
            timeout: 60000,
          });

          const imageBinaryData = imageResponse.data;
          const compressedImage = await jimp.read(imageBinaryData);
          await compressedImage.writeAsync(newImagePath);
          const img64 = await compressedImage.getBase64Async(jimp.MIME_PNG);

          eventSender.send("modelImageEvent", {
            modelName: model,
            title: titleEn,
            image: img64,
          });

          result.push({
            model,
            title: titleEn,
            path: newImagePath,
          });

          imageFound = true;
          eventSender.send("modelSavedEvent", model);
          break;
        } catch (error) {
          console.log(`Failed to load image from ${fullImageUrl}, trying next backend.`);
        }
      }

      if (!imageFound) {
        await handleNotFoundCase(model, notFoundImage);
      }

    } catch (error) {
      console.error(`Error processing model ${model}:`, error.message);
      await handleNotFoundCase(model, notFoundImage);
    }
  }

  // Process all models
  for (const model of modelsList) {
    try {
      await postDataWithRetry(model, 3);
    } catch (err) {
      console.error(`Error processing model ${model}:`, err);
      await handleNotFoundCase(model, notFoundImage);
    }
  }

  return result;
}